    function calculatePTU(bool _isAnchor, uint _amount, uint _totalSupply, uint _reserve, uint _reservePylon, uint _gamma, uint _vab) pure internal returns (uint liquidity){
        if (_isAnchor) {
            liquidity = _amount.mul(_totalSupply)/_vab;
